import dummy from "../db/data.json"
import './Dummy.scss'

export default function Dummy(){
    console.log(dummy)
    return <div>
        <div>
            {dummy.map(dummy => (
                <div  className="ListDummy" key={(dummy.name)}>  
                    {dummy.name}
                    {dummy.email},
                    {dummy.body}
                </div> 
            ))} 
        </div>
    </div>
}
